import React, { lazy } from 'react'
//import Tables from '../table/table.js'
import TableCard from '../table/TableCard.js';



const WidgetsDropdown = lazy(() => import('../widgets/WidgetsDropdown.js'))

const columns = [
  {
    dataField: "#Order",
    text: "Order Id",

  },
  {
    dataField: "Title",
    text: "Title",

    sort: true
  },
  {
    dataField: "status",
    text: "Status",

  },
  {
    dataField: "origin",
    text: "Origin",

  },
  {
      dataField: "Action",
      text: "Action",

    }
];

const products = [
  {
    '#Order': "#7882992",
    price: 100,
    Title: 10,
    status: "japan",
    Action:<button>Delete</button>

  },

];
const Dashboard = () => {
  return (
    <>
      <WidgetsDropdown />
      <div className="container card">


      <TableCard columns={columns} products={products}/>
      </div>

    </>
  )
}

export default Dashboard
